import './index.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
	return (
		<Router>
			<Switch>
				<Route path="/" exact={true} component={Home} />
				<Route path="/flights" exact={true} component={ClientList} />
				<Route path="/clients/:id" component={ClientEdit} />
			</Switch>
		</Router>
	);
}

export default App;
